import React from 'react';
import 'antd/dist/antd.css';
import { Redirect, Route } from 'react-router-dom';
import "./StyleMenu.css";

export default function LayoutEspecial(props) {

    const { routes } = props;

    // const user = null;
    // if (!user) {

    //     return (
    //         <>
    //             <Route path="/" component={homepage} />
    //             <Redirect to="/" />
    //        </>
    //     )
    // }


    return (

        <div>
            <header>
                <div className="sticky-top">
                    <nav className="navbar navbar-expand-lg navbar-light bg-light">
                        <a className="navbar-brand" href="">Home</a>
                        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                            <span className="navbar-toggler-icon"></span>
                        </button>

                        <div className="collapse navbar-collapse" id="navbarSupportedContent">
                            <ul className="navbar-nav mr-auto">
                                <li className="nav-item ">
                                    <a className="nav-link" href="../Lista de Bebidas Calientes/Reports.html">Clientes<span className="sr-only">(current)</span></a>
                                </li>

                                <li className="nav-item">
                                    <a className="nav-link" href="../Lista de Bebidas Calientes/PersonDevice.html">Proveedores</a>
                                </li>

                                <li className="nav-item">
                                    <a className="nav-link" href="../Lista de Bebidas Calientes/Requests.html">Administracion</a>
                                </li>

                                <li className="nav-item">
                                    <a className="nav-link " href="../Lista de Bebidas Calientes/Personal.html">Seguridad</a>
                                </li>

                                <li className="nav-item">
                                    <a className="nav-link" href="../Lista de Bebidas Calientes/PersonDevice.html">Informacion</a>
                                </li>

                                <li id="btnAudit" className="nav-item">
                                    <a className="nav-link" href="../Lista de Bebidas Calientes/BackLog.html">Reportes</a>
                                </li>
                                <li id="btnAudit" className="nav-item" >

                                    <a className="nav-link" href="../Lista de Bebidas Calientes/BackLog.html">Restaurantes</a>
                                </li>
                                <li id="btSystUsers" className="nav-item dropdown">
                                    <a className="nav-link dropdown-toggle" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">Ayuda</a>
                                    <div className="dropdown-menu" hidden aria-labelledby="navbarDropdown">
                                        <a className="dropdown-item" href="../Lista de Bebidas Calientes/SystemUser.html">View All</a>
                                        <div className="dropdown-divider"></div>
                                        <a className="dropdown-item" href="../Lista de Bebidas Calientes/CreateSysUser.html">New System User</a>
                                        <div className="dropdown-divider"></div>
                                        <a className="dropdown-item" href="../Lista de Bebidas Calientes/EditSysUser.html">Edit System User</a>
                                    </div>
                                </li>
                                <li id="btnLogOut" className="nav-item">
                                    <a className="nav-link" href="../Lista de Bebidas Calientes/Login.html">Cerrar Sesion</a>
                                </li>

                            </ul>
                        </div>

                    </nav>
                    <div className="spanheader"></div>
                </div>
            </header>
            <div style={{ padding: '0 50px' }}>

                <LoadRouters routes={routes} />

            </div>

        </div>

    );

}


function LoadRouters({ routes }) {

    return routes.map((route, index) => (

        <Route
            key={index}
            path={route.path}
            exact={route.exact}
            component={route.component}
        />

    ));
}
